  \"2016-11-25T21:06:36.907122\",\n\t\"name\": \"1993-94-schools-and-staffing-survey\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Schools and Staffing Survey, 1993-94
  (SASS 93-94), is a study that is part of the Schools and Staffing Survey (SASS)
  program; program data is available since 1987-88 at <http://nces.ed.gov/surveys/sass/dataproducts.asp>.
  SASS 93-94 (http://nces.ed.gov/surveys/sass) is a collection of surveys that cover
  a wide range of topics from teacher demand, teacher and principal characteristics,
  general conditions in schools, principalsufffd and teachersufffd perceptions of
  school climate and problems in their schools, teacher compensation, district hiring
  and retention practices, to basic characteristics of the student population and
  school library resources and staffing. The surveys were conducted using questionnaires,
  personal interviews, list data, and telephone interviews. Superintendents, teachers,
  librarians, principals, and school coordinators were sampled. Key statistics from
  SASS 93-94 are the percentage of newly-hired teachers, average teacher salary, average
  principal salary, percentage distribution of students receiving free or reduced-price
  lunches, percentage distribution of students by race and ethnicity, percentage distribution
  of teachers and principals by race and ethnicity, and age distributions of teachers
  and principals.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
